control.onControlLoad:
                          //鼠标点击行激活处理
g5.userId = null;
g5.tableClick = function(sender) {
    var c, x, y;
    for (y = 0; y < g5.pageSize; y++) {
        for (x = 0; x < 6; x++) {
            c = ee.getTableCell(ee.getControl("tablebody1"), x, y);
            c.style.backgroundColor = "";    
        }
    }
    for (x = 0; x < 6; x++) {
        c = ee.getTableCell(ee.getControl("tablebody1"), x, sender.rowIndex);
        c.style.backgroundColor = "#E0EEFF";
    }
    if (eb.isEmpty(g5.dataset1)) {
        g5.userId = null;
        return;
    }
    g5.id = parseInt(g5.dataset1.getData(0, sender.rowIndex));
    g5.vehicleName = g5.dataset1.getData(1, sender.rowIndex);
    g5.vehicleType = g5.dataset1.getData(2, sender.rowIndex);
    g5.vehicleManager = g5.dataset1.getData(3, sender.rowIndex);
    g5.status = g5.dataset1.getData(4, sender.rowIndex);    
}



//分页处理
g5.pageSize = 15;
g5.pageCurrent = 1;
g5.pageCount = 1;
g5.pageJump = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount) {
        pageNumber = g5.pageCount;
    }
    if (g5.pageCurrent != pageNumber) {
        g5.pageCurrent = pageNumber;
        if (g5.pageCurrent > 0) {
            query();
        }
    }
}

query();

control.onClick:
ee.setText(ee.getControl("panel50"), "0");
ee.setEditText(ee.getControl("edit7"), "");
ee.setEditText(ee.getControl("edit8"), "");
ee.setEditText(ee.getControl("edit5"), "");
ee.setEditText(ee.getControl("edit1"), "");
g5.operation = "new";
ee.showAni(ee.getControl("panel41"));

if (eb.isEmpty(g5.id) || isNaN(g5.id)) {
    alert("请选择有效的记录进行编辑");
    return;
}
ee.setText(ee.getControl("panel50"), g5.id);
ee.setEditText(ee.getControl("edit7"), g5.vehicleName);
ee.setEditText(ee.getControl("edit8"), g5.vehicleType);
ee.setEditText(ee.getControl("edit5"), g5.vehicleManager);  
ee.setEditText(ee.getControl("edit1"), g5.status);

g5.operation = "edit";
ee.showAni(ee.getControl("panel41"));

if (eb.isEmpty(g5.id) || isNaN(g5.id)) {
    alert("请选择有效的记录进行操作");
    return;
}
if (!confirm("删除操作将导致不可返回的后果，如需恢复数据只有联系网管，您是否继续这个危险的操作？")) {
    return;
}
del();

taskSetItem.script2:
var token = eio.readString8();
var searchText = eio.readString8();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

//获取记录数量
var condition = "";
if (searchText != "") {
    condition +=
        " and (" +
        "(cast(id as varchar(15)) like '%" + db.encode(searchText) + "%') or " +
        "([vehicleName] like '%" + db.encode(searchText) + "%') or " +
        "([vehicleType] like '%" + db.encode(searchText) + "%') or " + 
         "([vehicleManager] like '%" + db.encode(searchText) + "%') or " +
        "([status] like '%" + db.encode(searchText) + "%')) ";
}
sql =
    "SELECT count(*) as c " +
    "FROM vehicleInfo " +
    "WHERE ([status] <> 'DEL') " + condition;    
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql= 
    "SELECT * " +
    "FROM vehicleInfo " +
    "WHERE (status <> 'DEL') " + condition +
    "ORDER BY id DESC ";     
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"id,vehicleName,vehicleType,vehicleManager,status,regDatetime", pageSize*(pageCurrent-1), pageSize);

